We start with the expression \(\sin 20^\circ \sin 40^\circ \sin 60^\circ \sin 80^\circ \sin 100^\circ \sin 120^\circ \sin 140^\circ \sin 160^\circ\). Using the identity \(\sin(180^\circ - x) = \sin x\), we can rewrite the expression as:

\[
\sin 20^\circ \sin 40^\circ \sin 60^\circ \sin 80^\circ \sin (180^\circ - 80^\circ) \sin (180^\circ - 60^\circ) \sin (180^\circ - 40^\circ) \sin (180^\circ - 20^\circ)
\]

This simplifies to:

\[
\sin 20^\circ \sin 40^\circ \sin 60^\circ \sin 80^\circ \sin 80^\circ \sin 60^\circ \sin 40^\circ \sin 20^\circ = (\sin 20^\circ \sin 40^\circ \sin 60^\circ \sin 80^\circ)^2
\]

We know that \(\sin 60^\circ = \frac{\sqrt{3}}{2}\), so the expression becomes:

\[
\left( \sin 20^\circ \sin 40^\circ \sin 80^\circ \cdot \frac{\sqrt{3}}{2} \right)^2 = \frac{3}{4} (\sin 20^\circ \sin 40^\circ \sin 80^\circ)^2
\]

Next, we use the identity for the product of sines of angles in arithmetic progression. Specifically, for \(n = 3\) and \(\theta = 20^\circ\), we have:

\[
\sin 20^\circ \sin 40^\circ \sin 60^\circ = \frac{\sin 3 \cdot 60^\circ}{4 \sin 60^\circ} = \frac{\sin 180^\circ}{4 \cdot \frac{\sqrt{3}}{2}} = \frac{0}{2\sqrt{3}} = 0
\]

